  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity data (300 records) were compiled
  by Purdue University. This data base was received in February 1993. Principal gravity
  parameters include Free-air Anomalies and Simple Bouguer Anomalies (no terrain correction
  applied). The observed gravity values are referenced to the International Gravity
  Standardization Net 1971 (IGSN 71). The gravity anomaly computation uses the Geodetic
  Reference System 1967 (GRS 67) theoretical gravity formula. The data appear as 3
  transect lines-- two parallel lines in a northwest to southeast direction and one
  line in a northeast to southwest direction.\",\n\t\"license_title\": null,\n\t\"extras\":
